//创建聊天信息
var ChatModel = {
    Create: function () {
        //外框
        var div_All = document.createElement("div");
        //信息框
        var div_Send = document.createElement("div");
        div_Send.setAttribute("class", "sendInfo");
        div_Send.setAttribute("style", (ChatModel.isLeft ? "float: right;" : "float: left;"));
        div_Send.innerHTML = ChatModel.chatInfo;
        var div_Arrow = document.createElement("div");
        div_Arrow.setAttribute("class", (ChatModel.isLeft ? "leftArrow" : "rightArrow"));
        div_Send.appendChild(div_Arrow);
        div_All.appendChild(div_Send);
        //图片索引
        var div_Icon = document.createElement("div");
        div_Icon.setAttribute("class", (ChatModel.isLeft ? "Icon leftIcon" : "Icon rightIcon"));
        div_Icon.setAttribute("title", ChatModel.chatName);
        var img_Icon = document.createElement("img");
        img_Icon.setAttribute("src", ChatModel.iconUrl);
        img_Icon.setAttribute("alt", ChatModel.chatName);
        img_Icon.setAttribute("title", ChatModel.chatName);
        div_Icon.appendChild(img_Icon);
        div_All.appendChild(div_Icon);
        document.getElementsByClassName(ChatModel.divClassName).appendChild(div_All);
    },
    chatInfo: "",
    iconUrl: "data:image/jpeg;base64,",
    chatName: "",
    isLeft: true,
    divClassName: ""
};

ChatModel.divClassName = "ShowMsg";
ChatModel.Create();
